        a {
          text-decoration: none;
          color: #472d2d;
          font-size: 1.2rem;
          box-sizing: border-box;
          width: 100%;
          letter-spacing: 0.3px;

          .Navbar_li {
            font-family: "Alkatra", cursive;
            cursor: pointer;
            border-radius: 4px;
            text-align: center;
            background-color: white;
            width: 100%;
            box-sizing: border-box;
          }
        }

        /* css for inner option */

        .InnerOptions {
          position: absolute;
          top: 69%;
          width: 17%;
          display: flex;
          flex-direction: column;
          align-items: flex-start;
          justify-content: center;
          color: #472d2d;
          box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px,
            rgba(0, 0, 0, 0.1) 0px 8px 16px;
          border-radius: 5px;
          background-color: white;
          display: none;
          z-index: 3;

          .InnerOptions_a {
            width: 100%;
            box-sizing: border-box;

            .InnerOptions_li {
              width: 100%;
              box-sizing: border-box;
              font-family: "Alkatra", cursive;
              font-size: 1.1rem;
              padding: 4px;

              &:hover {
                background-color: #553939;
                border-radius: 3px;
                color: white;
              }
            }
          }
        }
      }

      .NavContent:hover {
        .InnerOptions {
          display: flex;
        }
        .Navbar_li {
          background-color: #a77979;
          color: white;
        }
      }
    }
  }
`;

const NavBarForPhoneWindow = styled.div`
  width: 6%;
  display: flex;
  flex-direction: column;
  align-items: flex-end;
  justify-content: center;
  margin-right: 7px;
  padding: 2px;
  .NavBarForPhoneWindowMainContainer {
    width: 100%;
    img {
      width: 100%;
      filter: invert(100%);
    }
  }

  .Navabar_Items_Container {
  }
`;

const NavbarInnerContentContainer = styled.div`
  border: 2px solid pink;
  .NavabrContentForPhone {
    border: 2px solid purple;
  }
  .PhoneNavContentContainer {
    border: 2px solid yellow;
  }
  .PhoneNavContent {
    border: 2px solid red;
  }
  .Phone_Navbar_li {
    border: 2px solid crimson;
  }
`;
